#include <string>
#include <algorithm>

int countOccurrences(const std::string& word, const std::vector<std::string>& fileContent) {
    int count = 0;
    for (const auto& line : fileContent) {
        std::stringstream ss(line);
        std::vector<std::string> words((std::istream_iterator<std::string>(ss)), std::istream_iterator<std::string>());
        for (const auto& word : words) {
            if (word == word) {
                count++;
            }
        }
    }
    return count;
}

int main() {
    // Input file
    std::string filePath = "example.txt"; // Replace with your file path

    // Check if the file exists
    if (!std::fileExists(filePath)) {
        std::cerr << "Error: File not found!" << std::endl;
        return 1;
    }

    // Open the file
    std::ifstream file(filePath);
    if (!file.is_open()) {
        std::cerr << "Error: Could not open file!" << std::endl;
        return 1;
    }

    // Read file content
    std::vector<std::string> fileContent((std::istream_iterator<std::string>(file)), std::istream_iterator<std::string>());

    // Close the file
    file.close();

    // Input word to count
    std::string word;
    std::cout << "Enter a word to count occurrences: ";
    std::cin >> word;

    // Count occurrences
    int count = countOccurrences(word, fileContent);

    // Display the result
    std::cout << "The word \"" << word << "\" appears " << count << " times in the file." << std::endl;

    return 0;
}
